import React from "react";

export default function SupplierDashboard() {
  return (
    <div>
      <header style={{
        borderBottom: "1px solid #ccc",
        marginBottom: 24,
        paddingBottom: 12,
        background: "#f5f5f5" // Add a background for visibility
      }}>
        <h1>Smart Inventory Order Management System</h1>
        <nav>
          <span style={{ marginRight: 16, fontWeight: "bold" }}>Supplier Dashboard</span>
          <a href="/supplier/profile" style={{ marginRight: 12 }}>My Profile</a>
          <a href="/supplier/orders">My Orders</a>
        </nav>
      </header>
      <main>
        <h2>Supplier Dashboard</h2>
        <p>Welcome, Supplier!</p>
      </main>
    </div>
  );
}
